create or replace package zip_mgr as
  procedure insert_zip(x_zip in xmltype);
  procedure seed_zipcodes;
end zip_mgr;
/


create or replace package body zip_mgr as

procedure insert_zip(x_zip in xmltype) is

  v_zipcode       number(5);
  v_city          varchar2(35);
  v_state         varchar2(2);
  v_county        varchar2(25);
  v_city_id       number;
  v_count         number;


begin

  v_zipcode := x_zip.extract('/ZIP/ZIP_CODE/text()').getStringVal();
  v_city := x_zip.extract('/ZIP/CITY/text()').getStringVal();
  v_state := x_zip.extract('/ZIP/STATE/text()').getStringVal();
  v_county := x_zip.extract('/ZIP/COUNTY_NAME/text()').getStringVal();

  select count(*)
  into v_count
  from rnt_cities
  where name = v_city
  and county = v_county
  and state  = v_state;

  if v_count = 0 then
    insert into rnt_cities (city_id, name, county, state)
    values (rnt_cities_seq.nextval, v_city, v_county, v_state)
    returning city_id into v_city_id;
  else
    select city_id
    into v_city_id
    from rnt_cities
    where name = v_city
    and county = v_county
    and state  = v_state;
  end if;

  select count(*)
  into v_count
  from rnt_zipcodes
  where zipcode = v_zipcode;

  if v_count = 0 then
    insert into rnt_zipcodes(zipcode)
    values (v_zipcode);
  end if;

  select count(*)
  into v_count
  from rnt_city_zipcodes
  where city_id = v_city_id
  and zipcode = v_zipcode;

  if v_count = 0 then
    insert into rnt_city_zipcodes (city_id, zipcode)
    values (v_city_id, v_zipcode);
  end if;

  commit;

end insert_zip;

